import React, { useState } from 'react';
import { Box, Paper, useMediaQuery, useTheme } from '@mui/material';
import { Link, useLocation } from 'react-router-dom';

const Sidebar = () => {
  const location = useLocation();
  const [hovered, setHovered] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const isTablet = useMediaQuery(theme.breakpoints.between('sm', 'md'));

  const expanded = hovered || !isMobile;

  const menuItems = [
    { 
      path: '/', 
      icon: '/static/images/carrer_nav.jpeg',
      text: 'Manual Prediction', 
      alt: 'Karriere Navigation'
    },
    { 
      path: '/linkedin', 
      icon: '/static/images/linkedin_nav.jpg',
      text: 'LinkedIn Prediction',
      alt: 'LinkedIn Navigation'
    },
    { 
      path: '/batch', 
      icon: '/static/images/candi_batch_nav.jpg',
      text: 'Batch Upload',
      alt: 'Batch Navigation'
    },
    { 
      path: '/candidates', 
      icon: '/static/images/candidates.png',
      text: 'Candidates',
      alt: 'Kandidaten Navigation'
    }
  ];

  const bottomButtons = [
    { icon: '/static/images/settings.svg', alt: 'Einstellungen' },
    { icon: '/static/images/info.svg', alt: 'Info' },
    { icon: '/static/images/plus.svg', alt: 'HinzufÃ¼gen' },
    { icon: '/static/images/arrow.svg', alt: 'Weiter' },
  ];

  return (
    <Paper
      elevation={3}
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: {
          xs: expanded ? '200px' : '80px',
          sm: expanded ? '240px' : '80px',
          md: expanded ? '260px' : '80px'
        },
        height: '100vh',
        bgcolor: '#fff',
        borderRadius: 0,
        boxShadow: '0 8px 32px rgba(0,0,0,0.08)',
        zIndex: 1000,
        overflow: 'hidden',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-between',
        border: 'none',
        gap: { xs: 1, sm: 1.5, md: 2 },
        transition: 'width 0.3s ease-in-out',
      }}
      onMouseEnter={() => !isMobile && setHovered(true)}
      onMouseLeave={() => !isMobile && setHovered(false)}
    >
      <Box sx={{ 
        width: '100%', 
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center', 
        pt: { xs: 2, sm: 2.5 }, 
        pb: { xs: 1.5, sm: 2 } 
      }}>
        <a 
          href="https://www.aurio.ai/de/"
          target="_blank" 
          rel="noopener noreferrer"
          style={{ textDecoration: 'none' }}
        >
          <img 
            src="/static/images/logo.png"
            alt="Aurio Technology Logo"
            style={{ 
              width: expanded ? { xs: '100px', sm: '110px', md: '120px' } : { xs: '60px', sm: '70px', md: '80px' },
              height: 'auto',
              marginBottom: expanded ? { xs: 8, sm: 10, md: 12 } : { xs: 6, sm: 8, md: 10 }
            }}
          />
        </a>
        <a 
          href="https://www-mis.ur.de/master" 
          target="_blank" 
          rel="noopener noreferrer"
          style={{ textDecoration: 'none' }}
        >
          <img 
            src="/static/images/ur-logo.png"
            alt="UR Logo"
            style={{ 
              width: expanded ? { xs: '100px', sm: '110px', md: '120px' } : { xs: '60px', sm: '70px', md: '80px' },
              height: 'auto',
              marginBottom: expanded ? { xs: 12, sm: 15, md: 18 } : { xs: 8, sm: 10, md: 12 }
            }}
          />
        </a>
      </Box>

      {/* Navigation */}
      <Box sx={{ 
        flex: 1, 
        display: 'flex', 
        flexDirection: 'column', 
        gap: { xs: 1, sm: 1.5, md: 2 }, 
        alignItems: 'center', 
        width: '100%', 
        mt: { xs: 1, sm: 1.5, md: 2 } 
      }}>
        {menuItems.map((item) => (
          <Box
            key={item.path}
            component={Link}
            to={item.path}
            sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              textDecoration: 'none',
              bgcolor: location.pathname === item.path ? 'rgba(255,128,0,0.08)' : 'transparent',
              borderRadius: { xs: "8px", sm: "10px", md: "12px" },
              py: { xs: 2, sm: 2.5 },
              px: 0,
              width: '100%',
              transition: 'all 0.3s ease',
              '&:hover': {
                bgcolor: 'rgba(255,128,0,0.13)',
              },
              mt: 0.5,
            }}
          >
            <img
              src={item.icon}
              alt={item.alt}
              style={{
                width: { xs: 32, sm: 35, md: 38 },
                height: { xs: 32, sm: 35, md: 38 },
                objectFit: 'contain',
                marginBottom: expanded ? 0 : 0,
                filter: 'grayscale(1) contrast(1.5) brightness(1.1)',
              }}
            />
            {expanded && (
              <Box
                sx={{
                  color: location.pathname === item.path ? '#FF8000' : '#222',
                  fontWeight: location.pathname === item.path ? 700 : 650,
                  fontSize: { xs: '0.7rem', sm: '0.75rem', md: '0.8rem' },
                  textAlign: 'center',
                  whiteSpace: 'nowrap',
                  letterSpacing: 0.2,
                  mt: 0.5,
                }}
              >
                {item.text}
              </Box>
            )}
          </Box>
        ))}
      </Box>
    </Paper>
  );
};

export default Sidebar;
